You can use C++ to write a program that reads a text file line by line and counts the number of occurrences of a specific word in the file. Here is an example of how you can use C++ to do this:
#include <iostream>
#include <string>

using namespace std;

int main() {
    string line;
    int count = 0;
    int word;
    while (getline(&line, &count, '\n')) {
        word = line.find(word);
        if (word == string::npos) {
            cout << "There is no word " << word << "\n";
            return 0;
        }
        else {
            cout << count << " " << word << "\n";
            count++;
        }
    }
    return 0;
}
